module.exports = "<div class=\"about-page\">\n    <menu></menu>\n    <title></title>\n    <h2 id=\"tagline\">Everyone has a story.</h2>\n    <div class=\"about-content-div\">\n        <p id=\"primary-info\" class=\"content\">\n            Bragging Rights is an opportunity to learn more about \n            your coworkers as they share the highs and lows of their \n            social/professional journey lines.\n        </p>\n    </div>\n    <button mat-raised-button class=\"content-btn\" (click)=\"toggleContent('story')\">\n        <div class=\"about-header\">\n            <h3>Our Story</h3>\n        </div>  \n        <div id=\"story\" class=\"about-content-div\" hidden=true>\n            <p class=\"content\">\n                Bragging Rights was conceptualized by <strong>Amy Dalton</strong> (UX Designer)\n                as a way to empower women to speak up about their achievements\n                and the obstacles they faced in pursuit of their goals. \n                She approached <strong>Allyson Mackay</strong>  (Product Manager) with the idea. \n                Allyson incorporated agile timelines to represent the history of \n                the Braggers. Amy then approached <strong>AmbyrShae Jarrell</strong> \n                (Software Engineer) to be one of the first Braggers. Once Amy \n                explained the idea, AmbyrShae decided to build a web app that \n                could be reused for other Braggers. Thus, the three women worked \n                together to make the first Bragging Session a success.\n            </p>\n        </div>\n    </button>\n    <button mat-raised-button class=\"content-btn\" (click)=\"toggleContent('join')\">\n        <div class=\"about-header\">\n            <h3>Join the Brag</h3>\n        </div>  \n        <div id=\"join\" class=\"about-content-div\" hidden=true>\n            <p class=\"content\">\n                If you'd like to speak at one of the monthly sessions, nominate someone\n                to speak or host your own Bragging Rights sessions,<strong> please contact\n                Amy Dalton at amy.dalton@ge.com</strong>.\n            </p>\n        </div>\n    </button>\n    <button mat-raised-button class=\"content-btn\" (click)=\"toggleContent('contribute')\">\n        <div class=\"about-header\">\n            <h3>Contribute</h3>\n        </div>  \n        <div id=\"contribute\" class=\"about-content-div\" hidden=true>\n            <p class=\"content\">\n                Monthly Bragging Rights sessions are currently held by the \n                Women's Network at GE Digital in New Orleans. Their first \n                session was held in December 2017 and continues to grow. \n                Thus, AmbyrShae adds new features in her spare \n                time. <strong>If you would like to contribute to the web app, please submit a pull request at \n                <a href=\"https://github.com/AmbyrShae/bragging-rights\" target=\"_blank\">github.com/AmbyrShae/bragging-rights</a></strong>. \n                To learn more about AmbyrShae, please visit <a href=\"https://ambyrshae.com\" target=\"_blank\">ambyrshae.com</a>.\n            </p>\n        </div>\n    </button>\n</div>"

